import { BrowserRouter } from 'react-router-dom';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

// TO DO: Export Browser Router from React Router DOM and test the live server!

ReactDOM.render(
  <BrowserRouter>
  <App />,
  </BrowserRouter>,
  document.getElementById('root')
);
